import React from 'react';

const Eader = () => {
    return (
        <header className="navbar navbar-expand-lg navbar-light bg-success-subtle text-info-emphasis p-4">
            <div className="container-fluid">
                <a className="navbar-brand" href="#">
                    Mental
                </a>
            </div>
        </header>
    );
};

export default Eader;
